Information
------------------------------

International Terrorism: The Global War on Terror
The terrorist is by no means a new actor on the world stage. However, thanks to startling developments in military and communications technology, this perennial threat to freedom and security has taken a quantum leap forward during the past thirty years. In many cases, these vicious and determined men and women have supplanted nation states on the globe's &quot;most wanted&quot; list! This extraordinary 26-episode series provides a comprehensive look at these modern masters of political murder and extortion. From the I.R.A. to al-Qaeda, Global Terror runs the gamut of groups that have pledged themselves to destroy the stability that we cling to so tenuously-examining their goals, their methods and their terrifying prospects for success!




9)  Nasser and Egyptian Terrorism 
As President of Egypt, Gamal Abdul Nasser wanted to be regarded as a distinguished international statesman. He was also the man who founded the Palestine Liberation Organisation, one of the world's greatest ever terrorist movements. But once he handed the PLO over to Yasser Arafat, Nasser ceased to have any real influence over the organisation.





